import React from 'react'
import BAIcon from '../assets/ba-icon.svg'
import AnketIcon from '../assets/anketicon.svg'
import User from '../assets/user1.svg'

function Navbar() {
    const [open, setOpen] = React.useState(false);

    const handleOpen = () => {
        setOpen(!open);
    };

    const handleMenuOne = () => {
